export default function SignForm(props) {
  return (
    <form className='sing-form' onSubmit={props.onSubmit()}>
      <h2 className='sign-from__title'>{props.title}</h2>
      <fieldset className='sign-from__fieldset'>{props.children}</fieldset>
    </form>
  );
}
